import { useState, useEffect } from "react";
import axios from "axios";

export default function App() {

  const [queue, setQueue] = useState([]);

  useEffect(() => {
    axios.get('/queue/get')
    .then((response) => setQueue(response.data))
    .catch((error) => {
       //TODO handle error
      });
  }, []);

  return (
    <div>
      <Queue queue={queue}/>
      {queue.map(track => <div key={track.id}>{track.id}</div>)}
    </div>
  );
}
